class App extends Component {
constructor(props) {
    super(props);
    this.state = {
      posts: []
    }
  }render() {
    return (
      <Router>
        <Routes>
          <Route path="/questionario1" component={Questionario1} />
        </Routes>
      </Router>
          )
  }
}

const Confirmacao = () => {
  <div class = "grid-container-emocao center">
    <div class = "grid-container-emocao-item item-1">
